import "./App.css";
import characters from "./fetchCharacters";
import { useState } from "react";

const App = () => {
  const [characters, setCharacters] = useState();
  return (
    <div>
      {characters.map((char) => (
        <p>{char.name}</p>
      ))}
    </div>
  );
};

export default App;
